  false,\n\t\"url\": null,\n\t\"notes\": \"The study design for the in-situ measurements
  consisted of an array of nine full-depth (or tall) moorings, six near-bottom moorings,
  and 25 Pressure Inverted Echo Sounders (PIES) deployed in U.S. waters. The overarching
  goal of this study is to increase knowledge of the dynamics of the Loop Current
  in the eastern Gulf of Mexico through a combined analysis of observations and numerical
  modeling output.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
